import { useQuery } from "@tanstack/react-query";
import axios from 'axios';

const allKittenUrl = "https://meowfacts.herokuapp.com/";

const getAllKitten = async() => {
    const response = await axios.get(allKittenUrl);
    return response.data;
}

export const UseGetAllKitten = () => {
    const {isLoading, data} = useQuery(['allKitten'], getAllKitten);
    return {data, isLoading}
}
